//github.com/aiida-vasp/aiida-vasp",image:"assets/aiida_plugin_symbol.png",description:"VASP is one of the most used codes in materials science, allowing for the determination of materials properties from first principles. <br> When I started in Sandvik one thing became clear, if we wanted to be able to make better predictions we needed a better system to submit, manage and store our calculations. <br> During my PostDoc in J\xFClich I got to hear about AiiDA and it became natural to integrate it into our way of working. <br> My journey with aiida-vasp started with asking questions and reporting issues, until I became a member of the development team, helping with bug fixes, code reviewing and introducing new features to improve the capabilities of this tool.<br> Being part of the development team not only allowed me to be able to focus on the coding aspects that were critical for us, it also put me in contact with the rest of the aiida-vasp developers, greta people that have taught me much on materials science and software development.",short:"AiiDA plugin for the VASP code, for the automation of the calculation of materials properties from first principles.",technologies:"Python, VAPS, AiiDA."},{title:"aiida-lammps",link:"https://github.com/aiidaplugins/aiida-lammps",image:"assets/aiida_plugin_symbol.png",description:"LAMMPS is one of the most used molecular dynamics software packages in materials science. Its flexibility and wide set of features allows the user to simulate almost anything. <br> This flexibility and scope is what makes building an AiiDA plugin for LAMMPS a daunting task, since one needs to account for a wide range of possibilities. <br>When we started to try to use the plugin in 2019 it was severely limited, with only a small set of options possible, this is why we embarked in a complete refactoring of the code base, making it more flexible, but while keeping the AiiDA design philosophies of provenance tracking and reproducibility.<br> Since that refactoring we are able to create our own workflows to study materials properties using LAMMPS and store them in the same footing than the rest of our calculations, allowing us to more efficiently study material properties for product development.",short:"AiiDA plugin for the LAMMPS code, for the automation of the calculation of materials properties using molecular dynamics.",technologies:"Python, LAMMPS, AiiDA."}],this.messageSource=new b1(this.projectsData),this.currentMessage=this.messageSource.asObservable()}};e.\u0275fac=function(i){return new(i||e)},e.\u0275prov=x({token:e,factory:e.\u0275fac,providedIn:"root"});let c=e;return c})();function Qo(c,e){if(c&1&&(v(0,"mat-card",2)(1,"mat-card-header")(2,"mat-card-title"),C(3),p()(),v(4,"div",3),w(5,"img",4),p(),v(6,"mat-card-content",5)(7,"p"),C(8),p(),v(9,"mat-icon",6),C(10,"terminal"),p(),C(11),p(),v(12,"mat-card-actions")(13,"a",7),C(14,"More information"),p()()()),c&2){let a=e.$implicit;z(3),v1(" ",a.title," "),z(2),F("src",a.image,F1),z(3),v1(" ",a.short," "),z(3),v1(" ",a.technologies," "),z(2),F("routerLink",a.title)}}var Oi=(()=>{let e=class e{constructor(t){this.projectDataService=t,this.projectsData=[]}ngOnInit(){this.subscription=this.projectDataService.currentMessage.subscribe(t=>this.projectsData=t)}ngOnDestroy(){this.subscription.unsubscribe()}};e.\u0275fac=function(i){return new(i||e)(h(u0))},e.\u0275cmp=N({type:e,selectors:[["app-projects"]],standalone:!0,features:[A],decls:4,vars:0,consts:[[1,"page-content"],[1,"projects-container"],[1,"project-card","bg-dark"],[1,"project-card-image-container"],["mat-card-image","",1,"project-card-image",3,"src"],[1,"project-card-content"],["mat-list-icon",""],["mat-button","",1,"btn","btn-primary","btn-sm",3,"routerLink"]],template:function(i,n){i&1&&(v(0,"div",0)(1,"div",1),w1(2,Qo,15,5,"mat-card",2,_1),p()()),i&2&&(z(2),y1(n.projectsData))},dependencies:[P2,I2,gc,T2,R2,O6,D2,a2,U3,f0,Pi,S2,c2],styles:[".page-content[_ngcontent-%COMP%]{display:flex;flex-direction